from burp import IBurpExtender, ITab, IHttpListener
from java.io import PrintWriter, ByteArrayInputStream
from java.awt import BorderLayout, GridBagLayout, GridBagConstraints, Insets
from java.awt.event import ActionListener, ItemListener
from javax.swing import JPanel, JLabel, JTextField, JButton, JTextArea, JScrollPane, JFileChooser, JOptionPane, SwingUtilities, JCheckBox, JSplitPane, ImageIcon
from javax.imageio import ImageIO
import threading
import os
import base64

try:
    from urlparse import urlparse
except ImportError:
    from urllib.parse import urlparse

BASE64_NO_WORDLIST_IMAGE = ""
BASE64_NOt_TXT = ""

class BurpExtender(IBurpExtender, ITab, IHttpListener):
    
    def registerExtenderCallbacks(self, callbacks):
        self._callbacks = callbacks
        self._helpers = callbacks.getHelpers()
        
        callbacks.setExtensionName("Path Ingester")
        
        self.stdout = PrintWriter(callbacks.getStdout(), True)
        self.stderr = PrintWriter(callbacks.getStderr(), True)
        
        # Wordlist storage
        self.wordlist = set()
        self.new_components = []
        self.wordlist_file = ""
        self.output_file = ""
        self.live_capture = False
        
        # UI
        self.tab = self._create_tab()
        callbacks.addSuiteTab(self)
        
        # Register as HTTP listener for live capture
        callbacks.registerHttpListener(self)
        
        self.stdout.println("[*] Path Ingester loaded")
    
    def _create_tab(self):
        """Create the main UI"""
        panel = JPanel(BorderLayout())
        
        # Top control panel
        control_panel = JPanel(GridBagLayout())
        gbc = GridBagConstraints()
        gbc.insets = Insets(5, 5, 5, 5)
        gbc.anchor = GridBagConstraints.WEST
        
        row = 0
        
        # Wordlist file selection (INPUT - check against)
        gbc.gridx, gbc.gridy = 0, row
        control_panel.add(JLabel("Wordlist File (check against):"), gbc)
        
        gbc.gridx = 1
        gbc.gridwidth = 2
        self.wordlist_field = JTextField(40)
        control_panel.add(self.wordlist_field, gbc)
        
        gbc.gridwidth = 1
        gbc.gridx = 3
        browse_wordlist_btn = JButton("Browse")
        browse_wordlist_btn.addActionListener(BrowseWordlistListener(self))
        control_panel.add(browse_wordlist_btn, gbc)
        
        row += 1
        gbc.gridx = 0
        gbc.gridy = row
        load_btn = JButton("Load Wordlist")
        load_btn.addActionListener(LoadListener(self))
        control_panel.add(load_btn, gbc)
        
        gbc.gridx = 1
        gbc.gridwidth = 2
        self.wordlist_status = JLabel("No wordlist loaded")
        control_panel.add(self.wordlist_status, gbc)
        
        # Output file selection
        row += 1
        gbc.gridx = 0
        gbc.gridy = row
        gbc.gridwidth = 1
        control_panel.add(JLabel("Output File (save new to):"), gbc)
        
        gbc.gridx = 1
        gbc.gridwidth = 2
        self.output_field = JTextField(40)
        control_panel.add(self.output_field, gbc)
        
        gbc.gridwidth = 1
        gbc.gridx = 3
        browse_output_btn = JButton("Browse")
        browse_output_btn.addActionListener(BrowseOutputListener(self))
        control_panel.add(browse_output_btn, gbc)
        
        # Live capture checkbox
        row += 1
        gbc.gridx = 0
        gbc.gridy = row
        gbc.gridwidth = 1
        self.live_checkbox = JCheckBox("Capture requests live")
        self.live_checkbox.addItemListener(LiveCheckboxListener(self))
        self.live_checkbox.setEnabled(False)
        control_panel.add(self.live_checkbox, gbc)
        
        gbc.gridx = 1
        gbc.gridwidth = 2
        self.live_status = JLabel("Disabled (load wordlist first)")
        control_panel.add(self.live_status, gbc)
        
        # Save button
        row += 1
        gbc.gridx = 0
        gbc.gridy = row
        gbc.gridwidth = 1
        self.save_btn = JButton("Save New Components")
        self.save_btn.addActionListener(SaveListener(self))
        control_panel.add(self.save_btn, gbc)
        
        gbc.gridx = 1
        gbc.gridwidth = 2
        self.save_status = JLabel("No components captured yet")
        control_panel.add(self.save_status, gbc)
        
        panel.add(control_panel, BorderLayout.NORTH)
        
        # Split pane for wordlists
        split_pane = JSplitPane(JSplitPane.HORIZONTAL_SPLIT)
        split_pane.setDividerLocation(400)
        
        # Left panel - current wordlist
        left_panel = JPanel(BorderLayout())
        left_label = JLabel("Current Wordlist:")
        left_panel.add(left_label, BorderLayout.NORTH)
        
        self.wordlist_area = JTextArea()
        self.wordlist_area.setEditable(False)
        self.wordlist_area.setLineWrap(True)
        self.wordlist_area.setWrapStyleWord(True)
        
        left_scroll = JScrollPane(self.wordlist_area)
        left_panel.add(left_scroll, BorderLayout.CENTER)
        
        # Right panel - new components
        right_panel = JPanel(BorderLayout())
        right_label = JLabel("New Components Found:")
        right_panel.add(right_label, BorderLayout.NORTH)
        
        self.output_area = JTextArea()
        self.output_area.setEditable(False)
        self.output_area.setLineWrap(True)
        self.output_area.setWrapStyleWord(True)
        
        right_scroll = JScrollPane(self.output_area)
        right_panel.add(right_scroll, BorderLayout.CENTER)
        
        split_pane.setLeftComponent(left_panel)
        split_pane.setRightComponent(right_panel)
        
        panel.add(split_pane, BorderLayout.CENTER)
        
        return panel
    
    def load_wordlist(self, filepath):
        """Load wordlist from file"""
        try:
            if not os.path.exists(filepath):
                self.stderr.println("[!] Wordlist file not found: " + filepath)
                self.wordlist_status.setText("File not found")
                self._show_error_with_image("Wordlist file not found!\n", BASE64_NO_WORDLIST_IMAGE)
                return False
            
            if filepath[-4:] != '.txt':
                self._show_error_with_image("NOT A TXT FILE:\n", BASE64_NOt_TXT)
                return False
            
            self.wordlist = set()
            wordlist_list = []
            with open(filepath, 'r') as f:
                for line in f:
                    word = line.strip().lower()
                    if word:
                        self.wordlist.add(word)
                        wordlist_list.append(word)
            
            # Display wordlist in left panel
            self.wordlist_area.setText('\n'.join(sorted(wordlist_list)))
            
            self.stdout.println("[+] Loaded %d words from: %s" % (len(self.wordlist), filepath))
            self.wordlist_status.setText("Loaded: %d words" % len(self.wordlist))
            self.wordlist_file = filepath
            
            # Enable live checkbox now that wordlist is loaded
            self.live_checkbox.setEnabled(True)
            self.live_status.setText("Ready - check to enable")
            
            return True
        
        except Exception as e:
            self.stderr.println("[!] Error loading wordlist: " + str(e))
            self.wordlist_status.setText("Error loading")
            self._show_error_with_image("Error loading wordlist:\n", BASE64_NO_WORDLIST_IMAGE)
            return False
    
    def _show_error_with_image(self, message, image):
        """Show error message with image in popup"""
        try:
            if not image:
                JOptionPane.showMessageDialog(None, message, "Wordlist Error", JOptionPane.ERROR_MESSAGE)
                return
            
            # Decode Base64 image
            image_data = base64.b64decode(image)
            image_stream = ByteArrayInputStream(image_data)
            buffered_image = ImageIO.read(image_stream)
            image_icon = ImageIcon(buffered_image)
            
            # Create message with icon
            label = JLabel(message)
            icon_label = JLabel(image_icon)
            
            # Create panel with both
            panel = JPanel(BorderLayout())
            panel.add(label, BorderLayout.NORTH)
            panel.add(icon_label, BorderLayout.CENTER)
            
            JOptionPane.showMessageDialog(None, panel, "Wordlist Error", JOptionPane.ERROR_MESSAGE)
        except Exception as e:
            # Fallback to simple message if image fails
            JOptionPane.showMessageDialog(None, message, "Wordlist Error", JOptionPane.ERROR_MESSAGE)
    
    def processHttpMessage(self, toolFlag, messageIsRequest, messageInfo):
        """Called when HTTP messages are sent/received"""
        try:
            # Only process requests, only if live capture is enabled
            if not messageIsRequest or not self.live_capture:
                return
            
            # Skip Burp's own traffic
            if toolFlag == self._callbacks.TOOL_PROXY or toolFlag == self._callbacks.TOOL_SPIDER:
                request = messageInfo.getRequest()
                
                if request:
                    # Analyze request to get URL
                    requestInfo = self._helpers.analyzeRequest(messageInfo)
                    url = requestInfo.getUrl()
                    
                    if url:
                        url_str = str(url)
                        
                        # Parse URL to get path only
                        parsed = urlparse(url_str)
                        path_only = parsed.path
                        
                        if path_only and path_only != '/':
                            # Split path into components
                            components = [c for c in path_only.split('/') if c]
                            
                            # Check each component against wordlist
                            for component in components:
                                component_lower = component.lower().strip()
                                
                                # Skip if component contains brackets or JSON-like chars
                                if '{' in component_lower or '[' in component_lower or ']' in component_lower or '}' in component_lower:
                                    continue
                                
                                if component_lower and component_lower not in self.wordlist:
                                    if component_lower not in self.new_components:
                                        self.new_components.append(component_lower)
                                        self._update_ui(component_lower)
                                        self.save_status.setText("Captured %d new components" % len(self.new_components))
        
        except Exception as e:
            self.stderr.println("[!] Error in live capture: " + str(e))
    
    def save_components(self):
        """Save new components to output file"""
        try:
            if not self.new_components:
                self.save_status.setText("No new components to save")
                return
            
            filepath = self.output_field.getText()
            if not filepath:
                self.save_status.setText("No output file specified")
                return
            
            # Ensure file ends with newline before appending
            if os.path.exists(filepath):
                with open(filepath, 'r') as f:
                    content = f.read()
                    # If file is not empty and doesn't end with newline, add one
                    if content and not content.endswith('\n'):
                        with open(filepath, 'a') as f2:
                            f2.write('\n')
            
            # Append new components
            with open(filepath, 'a') as f:
                for component in self.new_components:
                    f.write(component + '\n')
                    self.wordlist.add(component)
            
            self.stdout.println("[+] Saved %d new components to: %s" % (len(self.new_components), filepath))
            self.save_status.setText("Saved %d components" % len(self.new_components))
            
            # Reload wordlist display to show updated list
            self.load_wordlist(self.wordlist_file)
            
            # Clear new components
            self.new_components = []
            self.output_area.setText("")
        
        except Exception as e:
            self.stderr.println("[!] Error saving components: " + str(e))
            self.save_status.setText("Error saving - see logs")
    
    def set_live_capture(self, enabled):
        """Enable or disable live capture"""
        self.live_capture = enabled
        if enabled:
            self.live_status.setText("CAPTURING - all requests being processed")
            self.stdout.println("[*] Live capture ENABLED")
        else:
            self.live_status.setText("Ready - check to enable")
            self.stdout.println("[*] Live capture DISABLED")
    
    def _update_ui(self, component):
        """Update results display"""
        def update():
            current = self.output_area.getText()
            new_text = current + component + "\n"
            self.output_area.setText(new_text)
            self.output_area.setCaretPosition(len(new_text) - 1)
        
        SwingUtilities.invokeLater(update)
    
    def getTabCaption(self):
        return "Path Ingester"
    
    def getUiComponent(self):
        return self.tab


class BrowseWordlistListener(ActionListener):
    def __init__(self, extender):
        self.extender = extender
    
    def actionPerformed(self, event):
        chooser = JFileChooser()
        result = chooser.showOpenDialog(None)
        if result == JFileChooser.APPROVE_OPTION:
            filepath = str(chooser.getSelectedFile().getAbsolutePath())
            self.extender.wordlist_field.setText(filepath)


class BrowseOutputListener(ActionListener):
    def __init__(self, extender):
        self.extender = extender
    
    def actionPerformed(self, event):
        chooser = JFileChooser()
        result = chooser.showSaveDialog(None)
        if result == JFileChooser.APPROVE_OPTION:
            filepath = str(chooser.getSelectedFile().getAbsolutePath())
            self.extender.output_field.setText(filepath)


class LoadListener(ActionListener):
    def __init__(self, extender):
        self.extender = extender
    
    def actionPerformed(self, event):
        filepath = self.extender.wordlist_field.getText()
        if filepath:
            self.extender.load_wordlist(filepath)
        else:
            self.extender._show_error_with_image("Wordlist file not found!\n", BASE64_NO_WORDLIST_IMAGE)


class LiveCheckboxListener(ItemListener):
    def __init__(self, extender):
        self.extender = extender
    
    def itemStateChanged(self, event):
        from javax.swing import JCheckBox
        if isinstance(event.getSource(), JCheckBox):
            is_selected = event.getSource().isSelected()
            self.extender.set_live_capture(is_selected)


class SaveListener(ActionListener):
    def __init__(self, extender):
        self.extender = extender
    
    def actionPerformed(self, event):
        self.extender.save_components()
